import React from "react";

//redux
import { useSelector, useDispatch } from "react-redux";

const AdminBody = () => {
  const dispatch = useDispatch();

  //Redux global state property
  //from store
  const { products } = useSelector((state) => state.products);

  return (
    <div>
      <h1>Admin body</h1>
    </div>
  );
};

export default AdminBody;
